import React from "react";
import "../style.css"
import ContactCard from "./ContactCard";
function MyApp()
{
  return(
      <div className="contacts"> 
            <ContactCard 
            name="Kishan"
            imagUrl="app\src\Image\dog1.jpg"
            phone="123456"
            email="kishan@gmail.com"/>
      </div>
   )
}
export default MyApp
